In TypeScript, you can use type assertions to explicitly tell the type system that you know the type of a value, even if it may have multiple possible types.

Here's an example:

```typescript
interface Person {
  name: string;
  age: number;
}

interface Employee {
  name: string;
  age: number;
  department: string;
}

function getEmployee(id: number): Employee | Person {
  // ...
}

const employee = getEmployee(123);

// If we know that the returned value is definitely an Employee, we can use a type assertion to tell TypeScript that
const employeeName: string = (employee as Employee).name;
```

In this example, the `getEmployee` function returns either an `Employee` or a `Person`, depending on the data available. However, in this specific case, we know that the returned value will always be an `Employee`, so we can use a type assertion to tell TypeScript that we know this to be true.

The type assertion `(employee as Employee)` tells TypeScript that we're explicitly casting the `employee` variable to an `Employee` type, even though it may have been returned as a `Person`. This allows us to access the `name` property of the `Employee` type, which is not available on the `Person` type.

Note that type assertions should be used sparingly and only when you're confident that the type is correct. Overuse of type assertions can lead to errors and make your code harder to maintain.

